import React, { Component } from 'react';
import { BrowserRouter, Route, Switch } from "react-router-dom";
class  About extends Component {
  render(){
  return (
    <BrowserRouter>
            <div className="App">
             <Switch>
               <Route exact path='/About' component={About} />
              

              </Switch>
            </div>
    </BrowserRouter>
  );
}}

export default About;
